using WashMachine.Forms.Views.Login;
using WashMachine.Forms.Views.Shop;
using System;
using System.Drawing;
using System.IO;
using System.Linq;
using System.Windows.Forms;

namespace WashMachine.Forms.Views.Main.Coupon.Dialog
{
    public class ScanWaitingUI : Panel
    {
        public event EventHandler<bool> CancelHandler;

        public ScanWaitingUI()
        {
            Width = 750;
            Height = 600;

            TableLayoutPanel tblLayoutPanel = new TableLayoutPanel()
            {
                Dock = DockStyle.Fill,
            };

            tblLayoutPanel.Font = new Font(tblLayoutPanel.Font.FontFamily, 14f, FontStyle.Regular);

            tblLayoutPanel.RowStyles.Add(new RowStyle() { Height = 100, SizeType = SizeType.Absolute });
            tblLayoutPanel.RowStyles.Add(new RowStyle() { Height = 30, SizeType = SizeType.Percent });
            tblLayoutPanel.RowStyles.Add(new RowStyle() { Height = 70, SizeType = SizeType.Absolute });
            tblLayoutPanel.ColumnStyles.Add(new ColumnStyle() { Width = 100, SizeType = SizeType.Percent });
            Label lbTitle = new Label()
            {
                ForeColor = Color.White,
                Width = Width,
                Height = 100,
                TextAlign = ContentAlignment.MiddleCenter,
                Text = "以套票支付\r\nTicket Redeem"
            };
            Panel pnHeader = new Panel()
            {
                BackColor = ColorTranslator.FromHtml("#81C784"),
                Dock = DockStyle.Fill
            };
            pnHeader.Controls.Add(lbTitle);
            tblLayoutPanel.Controls.Add(pnHeader, 0, 0);

            TableLayoutPanel tblBody = new TableLayoutPanel()
            {
                Dock = DockStyle.Fill
            };
            tblBody.RowStyles.Add(new RowStyle() { Height = 80, SizeType = SizeType.Absolute });
            tblBody.RowStyles.Add(new RowStyle() { Height = 30, SizeType = SizeType.Percent });
            tblBody.RowStyles.Add(new RowStyle() { Height = 60, SizeType = SizeType.Absolute });
            tblBody.ColumnStyles.Add(new ColumnStyle() { Width = 100, SizeType = SizeType.Percent });

            Label lbBodyTitle = new Label()
            {
                ForeColor = ColorTranslator.FromHtml("#81C784"),
                Width = Width,
                TextAlign = ContentAlignment.TopCenter,
                Height = 100,
                Text = "請把套票的二維碼放在掃描器上\r\nPlease put the QRCode of the ticket to the scanner"
            };

            Panel pnBody = new Panel()
            {
                BackColor = Color.White,
                Dock = DockStyle.Fill
            };

            pnBody.Controls.Add(lbBodyTitle);
            tblBody.Controls.Add(pnBody, 0, 0);

            byte[] bytes = Convert.FromBase64String("");
            MemoryStream ms = new MemoryStream(bytes);
            Image imgBgCoupon = Image.FromStream(ms);
           
            ShopConfigModel shopConfig = Program.ShopConfig;
            if (shopConfig != null && shopConfig.ShopSetting != null)
            {
                if (shopConfig.ShopSetting.CouponScanImg != null)
                {
                    ms = new MemoryStream(shopConfig.ShopSetting.CouponScanImg);
                    imgBgCoupon = Image.FromStream(ms);
                }
            }

            PictureBox pbBg = new PictureBox
            {
                SizeMode = PictureBoxSizeMode.StretchImage,
                Image = imgBgCoupon,
                Width = 400,
                Height = 400,
            };
            pbBg.Location = new Point((Width - pbBg.Width) / 2, 0);

            Panel panelBg = new Panel()
            {
                Dock = DockStyle.Fill
            };
            panelBg.Controls.Add(pbBg);
            tblBody.Controls.Add(panelBg, 0, 1);

            Label lbBodyMessage = new Label()
            {
                Name = "lbMessage",
                ForeColor = ColorTranslator.FromHtml("#81C784"),
                Width = Width,
                TextAlign = ContentAlignment.TopCenter,
                Height = 100,
                Text = ""
            };

            Panel pnBodyMessage = new Panel()
            {
                BackColor = Color.White,
                Dock = DockStyle.Fill,
                Name = "pnMessage",
                Visible = true
            };

            pnBodyMessage.Controls.Add(lbBodyMessage);
            tblBody.Controls.Add(pnBodyMessage, 0, 2);

            tblLayoutPanel.Controls.Add(tblBody, 0, 1);

            TableLayoutPanel tblFooter = new TableLayoutPanel()
            {
                Dock = DockStyle.Fill
            };
            tblFooter.RowStyles.Add(new RowStyle() { Height = 50, SizeType = SizeType.Absolute });
            tblFooter.ColumnStyles.Add(new ColumnStyle() { Width = 100, SizeType = SizeType.Percent });

            bytes = Convert.FromBase64String("");
            ms = new MemoryStream(bytes);
            Image imgBack = Image.FromStream(ms);

            Panel pnBack = new Panel() { BackgroundImage = imgBack, Width = 120, BackgroundImageLayout = ImageLayout.Stretch, Height = 50 };
            pnBack.Click += BtnCancel_Click;
            tblFooter.Controls.Add(pnBack, 0, 0);

            tblLayoutPanel.Controls.Add(tblFooter, 0, 2);

            BackColor = Color.White;

            BorderStyle = BorderStyle.FixedSingle;
            Visible = false;
            Padding = new Padding(10);
            Controls.Add(tblLayoutPanel);
            SizeChanged += Panel_SizeChanged;
            Tag = tblLayoutPanel;
            VisibleChanged += ScanWaitingUI_VisibleChanged;
        }

        private void BtnCancel_Click(object sender, EventArgs e)
        {
            CancelHandler?.Invoke(sender, true);
        }

        private static void Panel_SizeChanged(object sender, System.EventArgs e)
        {
            Control control = sender as Control;
            Control tblLayoutPanel = control.Tag as Control;
            tblLayoutPanel.Location = new Point((500 - tblLayoutPanel.Width) / 2, (400 - tblLayoutPanel.Height) / 2);
        }

        private void ScanWaitingUI_VisibleChanged(object sender, EventArgs e)
        {
            if (Parent != null)
            {
                Control[] mainLayouts = Parent.Controls.Find("MainLayout", true);

                if (mainLayouts != null && mainLayouts.Length > 0)
                {
                    Control mainLayout = mainLayouts[0];

                    if (Visible)
                    {
                        mainLayout.Enabled = false;
                    }
                    else
                    {
                        mainLayout.Enabled = true;
                    }
                }
            }
        }

        public void SetParent(Form parent)
        {
            if (parent != null)
            {
                Parent = parent;
                Parent.SizeChanged += Parent_SizeChanged;
                Parent.Controls.SetChildIndex(this, 0);
                Parent_SizeChanged(parent, EventArgs.Empty);
            }
        }

        private void Parent_SizeChanged(object sender, EventArgs e)
        {
            Location = new Point((Parent.Width - Width) / 2, (Parent.Height - Height) / 2);
        }

        public void ResetDefault()
        {
            Label lbMessage = Controls.Find("lbMessage", true).First() as Label;
            lbMessage.Text = string.Empty;
            lbMessage.ForeColor = Color.Green;
        }

        public void SetMessage(string message, bool isError = false)
        {
            Label lbMessage = Controls.Find("lbMessage", true).First() as Label;
            if (!string.IsNullOrWhiteSpace(message))
            {
                lbMessage.Text = message;

                if (isError)
                {
                    lbMessage.ForeColor = Color.Red;
                }
            }
            else
            {
                lbMessage.Text = string.Empty;
                lbMessage.ForeColor = Color.Green;
            }
        }
    }
}
